import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import Button from "../../UI/Button";

const ReadOnlyRow = ({ user, isediting, Ondelete }) => {
  return (
    <tr key={user.id}>
      <td>
        <img src={user.Avator} alt={user.name}></img>
      </td>
      <td> {user.first_name}</td>
      <td> {user.last_name}</td>
      <td> {user.time}</td>
      <td> {user.email}</td>
      <td> {user.Job}</td>
      <td>{user.DateOfBirth}</td>
      <td>{user.donate} $</td>
      <td>
        {isediting && (
          <Fragment>
            <Button
              onClick={() => {
                {
                  confirm(`${user.first_name}  "permenantly?"`);
                  Ondelete(user.id);
                }// setDeleteControl(true);
              }}
            >
              Delete
            </Button>
            <Button
              onClick={() => {
                alert(`${user.first_name}  "Edit Button Clicked"`);
              }}
            >
              Edit
            </Button>
          </Fragment>
        )}
      </td>
    </tr>
  );
};

export default ReadOnlyRow;
